(297, 'f563046f435835cadeab0c1b286ab1eb', 'a:2:{s:7:\"timeout\";i:1573260333;s:5:\"value\";s:13884:\"{\"new_version\":\"4.6.3\",\"stable_version\":\"4.6.3\",\"name\":\"Media File Renamer Pro\",\"slug\":\"media-file-renamer-pro\",\"url\":\"https:\\/\\/store.meowapps.com\\/products\\/media-file-renamer-pro\\/?changelog=1\",\"last_updated\":\"1 week ago\",\"homepage\":\"https:\\/\\/store.meowapps.com\",\"sections\":{\"description\":\"<p>Media File Renamer Auto is a WordPress plugin that physically renames media files nicely for a cleaner system and for a better SEO. Please read this description.<\\/p>\\n<h3>IMPORTANT<\\/h3>This is an *automatic* renamer based on the Media title. This plugin features were all meant to be automatic depending on the title of the Media. Manual Rename (and a few more features) were added two years later, in a Pro version. I add complex features based on requests usually in the Pro to be able to maintain the quality of the plugin and its support.<h3>HOW IT WORKS<\\/h3>The plugin automatically renames your media filenames depending on their titles. When files are renamed, the references to it are also updated (posts, pages, custom types and their metadata). A new column in the Media Library will display to you the new ideal filename and a button will allow you to rename it straight away. You can lock and unlock the renaming automatic process through little icons. There is also a little dashboard called File Renamer in Media that will help you rename all your files at once. Advanced users can change the way the files are renamed by using the plugin\'s filters (check the FAQ). There is also a LOCK option on every image to avoid the filename to be modified any further.\\n\\n[youtube https:\\/\\/youtu.be\\/RjaA-b3avxs]<h3>PRO VERSION<\\/h3>The [Pro Version](https:\\/\\/meowapps.com\\/plugin\\/media-file-renamer\\/) gives a few more features like manual renaming, renaming depending on the post the media is attached to or the content of the alternative text (ALT), logging of SQL queries and a few more options. A good process is to actually let the plugin do the renaming automatically (like in the free version) and to do manual renaming for the files that require fine tuning.<h3>BE CAREFUL<\\/h3>File renaming is a dangerous process. Before renaming everything automatically, try to rename a few files first and check carefully that all the references to those files have been properly updated on your website. WordPress has so many themes and plugins that this renaming process can\'t unfortunately cover all the cases, especially if other plugins are using unconventional ways. If references aren\'t updated properly, please write a nice post (not an angry one) in the support threads :) I will try my best to cover more and more special cases. In any case, always make a **backup** of your database and files before using a plugin that alter your install. Also, if your website seems broken after a few renames, try to **clear your cache**. The cached HTML will indeed not be linked to the new filenames.<h3>FOR DEVELOPER<\\/h3>The plugin can be tweaked and reference updates enhanced for your themes\\/plugins. Have a look [here](https:\\/\\/meowapps.com\\/media-file-renamer-faq\\/).<h3>JUST TO MAKE SURE<\\/h3>This plugin will not allow you to change the filename *manually* in its standard version. The [Pro Version](https:\\/\\/meowapps.com\\/plugin\\/media-file-renamer\\/) is required. If you are about to *write an angry review* because this feature is not available, at least, please *mention that you read the whole description*.\\n\\nThis plugin works perfectly with WP Retina 2x, Polylang, WPML and many more. Is has been tested in Windows, Linux and OSX systems.\\n\\nLanguages: English, French.\",\"changelog\":\"<p>4.6.3<\\/p>\\n<ul>\\n<li>Add: Doesn\'t show the button to the Dashboard if Auto is disabled.<\\/li>\\n<li>Update: Admin refreshed to 2.4.<\\/li>\\n<\\/ul>\\n<p>4.6.1<\\/p>\\n<ul>\\n<li>Fix: Column wasn\'t displayed when manual enabled and automatic disabled.<\\/li>\\n<li>Fix: Admin Updater was a bit buggy.<\\/li>\\n<\\/ul>\\n<p>4.5.8<\\/p>\\n<ul>\\n<li>Fix: Fixed the AJAX\\/REST check.<\\/li>\\n<li>Update: Admin refresh.<\\/li>\\n<\\/ul>\\n<p>4.5.6<\\/p>\\n<ul>\\n<li>Update: Dashboard and Updater... updated.<\\/li>\\n<li>Fix: Search was sometimes not working properly in the Media Library.<\\/li>\\n<\\/ul>\\n<p>4.5.3<\\/p>\\n<ul>\\n<li>Update: Admin style update and common framework updated.<\\/li>\\n<li>Update: Compatibility with WordPress 5.1.<\\/li>\\n<\\/ul>\\n<p>4.5.2<\\/p>\\n<ul>\\n<li>Update: Code cleaning, Youtube video.<\\/li>\\n<li>Fix: Issue with updating the ALT field.<\\/li>\\n<\\/ul>\\n<p>4.4.0<\\/p>\\n<ul>\\n<li>Update: Compatibility with WP 5.0.<\\/li>\\n<li>Update: Compatibility with Real Media Library.<\\/li>\\n<\\/ul>\\n<p>4.2.8<\\/p>\\n<ul>\\n<li>Fix: Better support for Real Media Library.<\\/li>\\n<li>Update: Improved transliteration.<\\/li>\\n<\\/ul>\\n<p>4.2.4<\\/p>\\n<ul>\\n<li>Update: UTF-8 is handled by default, no need to have an option for it.<\\/li>\\n<li>Add: Option for transliteration (cyrillic, accents, umlauts).<\\/li>\\n<\\/ul>\\n<p>4.2.2<\\/p>\\n<ul>\\n<li>Add: Polylang compatibility.<\\/li>\\n<li>Update: UI enhancements and attempt to make the renaming faster.<\\/li>\\n<\\/ul>\\n<p>4.2.0<\\/p>\\n<ul>\\n<li>Add: All the actions in the Media Library are now asynchronous. No more page reload!<\\/li>\\n<li>Update: Many changes and little enhancements in the code, for speed, security and code-tidiness.<\\/li>\\n<\\/ul>\\n<p>4.0.6<\\/p>\\n<ul>\\n<li>Fix: Renaming using filters (work in progress).<\\/li>\\n<li>Fix: Insensitive-case match was giving the wrong file in some cases (webp for instance).<\\/li>\\n<\\/ul>\\n<p>4.0.2<\\/p>\\n<ul>\\n<li>Fix: Compatibility with PDF thumbnails.<\\/li>\\n<li>Update: Little improvements.<\\/li>\\n<\\/ul>\\n<p>4.0.1<\\/p>\\n<ul>\\n<li>Fix: Issue with the tolowercase feature.<\\/li>\\n<li>Fix: Extension issue with mfrh_new_filename filter.<\\/li>\\n<li>Add: Filter to rewrite Alt Text.<\\/li>\\n<\\/ul>\\n<p>4.0.0<\\/p>\\n<ul>\\n<li>Update: Huge code cleaning and major refactorization. The core was also rewritten.<\\/li>\\n<li>Add: Compatibility with Beaver Builder.<\\/li>\\n<li>Fix: Avoid looking for too much perfection (which is dangerous) when using numbered files.<\\/li>\\n<li>Fix: Works fine now with image sizes in the meta which has the... same size.<\\/li>\\n<\\/ul>\\n<p>3.7.3<\\/p>\\n<ul>\\n<li>Update: SSL fix.<\\/li>\\n<li>Update: Now uploading Media into Post rename the filename accordingly.<\\/li>\\n<\\/ul>\\n<p>3.7.1<\\/p>\\n<ul>\\n<li>Fix: Rename on Upload issue in a few cases.<\\/li>\\n<\\/ul>\\n<p>3.7.0<\\/p>\\n<ul>\\n<li>Update: Improved Rename on Upload.<\\/li>\\n<li>Fix: Annoying warning (but it was not causing any error).<\\/li>\\n<\\/ul>\\n<p>3.6.9<\\/p>\\n<ul>\\n<li>Update: Manual Rename allows a new extension.<\\/li>\\n<\\/ul>\\n<p>3.6.8<\\/p>\\n<ul>\\n<li>Add: Little API.<\\/li>\\n<\\/ul>\\n\"},\"banners\":{\"high\":\"https:\\/\\/store.meowapps.com\\/wp-content\\/uploads\\/edd\\/media-file-renamer-banner-1544x500.png\",\"low\":\"https:\\/\\/store.meowapps.com\\/wp-content\\/uploads\\/edd\\/media-file-renamer-banner-772x250.png\"},\"icons\":\"a:2:{s:2:\\\"1x\\\";s:87:\\\"https:\\/\\/store.meowapps.com\\/wp-content\\/uploads\\/edd\\/Media-File-Renamer-Square-128x128.jpg\\\";s:2:\\\"2x\\\";s:87:\\\"https:\\/\\/store.meowapps.com\\/wp-content\\/uploads\\/edd\\/Media-File-Renamer-Square-256x256.jpg\\\";}\",\"stable_tag\":\"4.6.3\",\"contributors\":{\"TigrouMeow\":{\"display_name\":\"TigrouMeow\",\"profile\":\"\\/\\/profiles.wordpress.org\\/TigrouMeow\",\"avatar\":\"https:\\/\\/wordpress.org\\/grav-redirect.php?user=TigrouMeow\"},\"amekusa\":{\"display_name\":\"amekusa\",\"profile\":\"\\/\\/profiles.wordpress.org\\/amekusa\",\"avatar\":\"https:\\/\\/wordpress.org\\/grav-redirect.php?user=amekusa\"}},\"added\":\"2017-05-03\",\"description\":[\"<p>Media File 