 on your website. WordPress has so many themes and plugins that this renaming process can\'t unfortunately cover all the cases, especially if other plugins are using unconventional ways. If references aren\'t updated properly, please write a nice post (not an angry one) in the support threads :) I will try my best to cover more and more special cases. In any case, always make a **backup** of your database and files before using a plugin that alter your install. Also, if your website seems broken after a few renames, try to **clear your cache**. The cached HTML will indeed not be linked to the new filenames.<h3>FOR DEVELOPER<\\/h3>The plugin can be tweaked and reference updates enhanced for your themes\\/plugins. Have a look [here](https:\\/\\/meowapps.com\\/media-file-renamer-faq\\/).<h3>JUST TO MAKE SURE<\\/h3>This plugin will not allow you to change the filename *manually* in its standard version. The [Pro Version](https:\\/\\/meowapps.com\\/plugin\\/media-file-renamer\\/) is required. If you are about to *write an angry review* because this feature is not available, at least, please *mention that you read the whole description*.\\n\\nThis plugin works perfectly with WP Retina 2x, Polylang, WPML and many more. Is has been tested in Windows, Linux and OSX systems.\\n\\nLanguages: English, French.\"],\"changelog\":[\"<p>4.6.3<\\/p>\\n<ul>\\n<li>Add: Doesn\'t show the button to the Dashboard if Auto is disabled.<\\/li>\\n<li>Update: Admin refreshed to 2.4.<\\/li>\\n<\\/ul>\\n<p>4.6.1<\\/p>\\n<ul>\\n<li>Fix: Column wasn\'t displayed when manual enabled and automatic disabled.<\\/li>\\n<li>Fix: Admin Updater was a bit buggy.<\\/li>\\n<\\/ul>\\n<p>4.5.8<\\/p>\\n<ul>\\n<li>Fix: Fixed the AJAX\\/REST check.<\\/li>\\n<li>Update: Admin refresh.<\\/li>\\n<\\/ul>\\n<p>4.5.6<\\/p>\\n<ul>\\n<li>Update: Dashboard and Updater... updated.<\\/li>\\n<li>Fix: Search was sometimes not working properly in the Media Library.<\\/li>\\n<\\/ul>\\n<p>4.5.3<\\/p>\\n<ul>\\n<li>Update: Admin s